const styles = {
  container: {
    minHeight: "100vh",
    background: "linear-gradient(135deg, #181c24 0%, #232b3b 100%)",
    padding: "2rem 0",
    fontFamily: "'Montserrat', Segoe UI, sans-serif",
  },
  countryCard: {
    background: "rgba(30,34,44,0.97)",
    borderRadius: "22px",
    boxShadow: "0 8px 32px 0 rgba(31, 38, 135, 0.18)",
    padding: "2.5rem",
    maxWidth: 1400,
    margin: "2.5rem auto",
    color: "#fff",
    backdropFilter: "blur(6px)",
    fontFamily: "'Montserrat', Segoe UI, sans-serif",
  },
  countryTitle: {
    fontSize: "2.7rem",
    fontWeight: 800,
    color: "#a991f7",
    marginBottom: "1.5rem",
    letterSpacing: "2px",
    textAlign: "center",
    fontFamily: "'Montserrat', Segoe UI, sans-serif",
  },
  imagesRow: {
    display: "flex",
    gap: "2rem",
    justifyContent: "center",
    flexWrap: "wrap",
    marginBottom: "2rem",
  },
  imgContainer: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    width: 340,
  },
  img: {
    width: 340,
    height: 220,
    objectFit: "cover",
    borderRadius: "18px",
    boxShadow: "0 4px 16px rgba(31,38,135,0.18)",
    marginBottom: "0.7rem"
  },
  attractionName: {
    fontWeight: 700,
    fontSize: "1.18rem",
    color: "#6e7ff3",
    textAlign: "center",
    fontFamily: "'Montserrat', Segoe UI, sans-serif",
    marginBottom: "1.2rem"
  },
  comingSoon: {
    textAlign: "center",
    color: "#a991f7",
    fontSize: "2rem",
    fontWeight: 700,
    margin: "3rem 0 2rem 0",
    fontFamily: "'Montserrat', Segoe UI, sans-serif",
    letterSpacing: "2px"
  }
};

function Catalogue() {
  return (
    <div style={styles.container}>
      {catalogueData.map((country) => (
        <div key={country.country} style={styles.countryCard}>
          <div style={styles.countryTitle}>{country.country}</div>
          <div style={styles.imagesRow}>
            {country.attractions.map((attr, idx) => (
              <div key={attr.name} style={styles.imgContainer}>
                <img src={attr.image} alt={attr.name} style={styles.img} />
                <div style={styles.attractionName}>{attr.name}</div>
              </div>
            ))}
          </div>
        </div>
      ))}
      <div style={styles.comingSoon}>More coming soon...</div>
    </div>
  );
}

export default Catalogue;
